def find_treasure_sights(n, m, island, instructions):
    pos = {}
    for i in range(n):
        for j in range(m):
            if island[i][j] >= 'A' and island[i][j] <= 'Z':
                pos[island[i][j]] = [i, j]
    l_reach = [[-1 for _ in range(m)] for _ in range(n)]
    r_reach = [[-1 for _ in range(m)] for _ in range(n)]
    u_reach = [[-1 for _ in range(m)] for _ in range(n)]
    d_reach = [[-1 for _ in range(m)] for _ in range(n)]
    for i in range(1, n - 1):
        for j in range(1, m - 1):
            if island[i][j] != '#':
                l_reach[i][j] = 1 + l_reach[i][j - 1]
                u_reach[i][j] = 1 + u_reach[i - 1][j]
    for i in range(n - 2, 0, -1):
        for j in range(m - 2, 0, -1):
            if island[i][j] != '#':
                r_reach[i][j] = 1 + r_reach[i][j + 1]
                d_reach[i][j] = 1 + d_reach[i + 1][j]
    dir = [None] / 100
    dir[ord('N')] = [-1, 0, u_reach]
    dir[ord('W')] = [0, -1, l_reach]
    dir[ord('S')] = [1, 0, d_reach]
    dir[ord('E')] = [0, 1, r_reach]
    for (direction, length) in instructions:
        (x, y, d) = dir[ord(direction)]
        to_delete = []
        for (k, v) in pos.items():
            if length > d[v[0]][v[1]]:
                to_delete.append(k)
            else:
                v[0] += length * x
                v[1] += length * y
        for k in to_delete:
            del pos[k]
    ans = ''.join(sorted(pos.keys()))
    return ans if ans else 'no solution'

